import{_ as e,o as t,c as r,O as n}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 63.2-1240 Court issuing order deemed sending agency under Interstate Compact on Placement of Children.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/63.2-1240.md","filePath":"vacode/63.2-1240.md"}'),o={name:"vacode/63.2-1240.md"},a=n('<h1 id="§-63-2-1240-court-issuing-order-deemed-sending-agency-under-interstate-compact-on-placement-of-children" tabindex="-1">§ 63.2-1240 Court issuing order deemed sending agency under Interstate Compact on Placement of Children. <a class="header-anchor" href="#§-63-2-1240-court-issuing-order-deemed-sending-agency-under-interstate-compact-on-placement-of-children" aria-label="Permalink to &quot;§ 63.2-1240 Court issuing order deemed sending agency under Interstate Compact on Placement of Children.&quot;">​</a></h1><p>When a petitioner moves outside the Commonwealth after the entry of an interlocutory order of adoption but prior to the entry of a final order of adoption and the child was not placed by a child-placing agency, the circuit court issuing the interlocutory order shall be deemed the sending agency for the purposes of the Interstate Compact on the Placement of Children authorized pursuant to the provisions of § <a href="http://law.lis.virginia.gov/vacode/63.2-1000/" target="_blank" rel="noreferrer">63.2-1000</a>.</p><p>1978, c. 733, § 63.1-226.1; 2000, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0830" target="_blank" rel="noreferrer">830</a>, § 63.1-219.47; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0747" target="_blank" rel="noreferrer">747</a>.</p>',3),i=[a];function d(c,s,l,h,p,u){return t(),r("div",null,i)}const _=e(o,[["render",d]]);export{f as __pageData,_ as default};
